import React from "react";

export const Header = ({ leftChild, Text, rightChild }) => {
  return (
    <div className="Header">
      <div className="Header__leftChild">{leftChild}</div>
      <div className="Header__text">{Text}안녕</div>
      <div className="Header__rightChild">{rightChild}웅</div>
    </div>
  );
};

Header.defaultProps = {
  leftChild: "",
  Text: "",
  rightChild: "",
};
